　石沢社長は会見で、同事務所が既に発表している対応策について「私たちとしてはまだ十分とは受け止めていない」と発言。申し入れ書では、実効性ある被害者救済の実施のほか、所属タレントが活動しやすい環境整備などを求めた。事務所側に渡した際に、社名変更などの検討要請も口頭で伝えたという。


